import React, { useRef } from "react";

// Placeholder images
const signup = "data:image/svg+xml,%3Csvg width='48' height='48' xmlns='http://www.w3.org/2000/svg'%3E%3Crect width='48' height='48' fill='%23666'/%3E%3C/svg%3E";
const illu = "data:image/svg+xml,%3Csvg width='400' height='300' xmlns='http://www.w3.org/2000/svg'%3E%3Crect width='400' height='300' fill='%23333'/%3E%3Ctext x='50%25' y='50%25' text-anchor='middle' fill='white' font-size='24'%3EIllustration%3C/text%3E%3C/svg%3E";

const illustrations = [illu, illu, illu, illu, illu];

const content = [
  { number: "01", heading: "Your data stays yours", body: "Your health data is encrypted, never sold, and never shared without your permission." },
  { number: "02", heading: "Built for safety first", body: "AI Doctor avoids harmful or risky recommendations and escalates to clinicians." },
  { number: "03", heading: "Transparent and in your control", body: "You can see why the AI makes decisions. No black boxes." },
  { number: "04", heading: "Medically validated", body: "Every AI Doctor is reviewed by licensed physicians." },
  { number: "05", heading: "Regulation compliant", body: "Complies with HIPAA and medical AI safeguards." }
];

export default function ScrollCarousel() {
  const sectionRefs = useRef([]);

  return (
    <div className="scroll-carousel">
      {/* LEFT CONTENT - STICKY SECTIONS */}
      <div className="carousel-left">
        {content.map((item, index) => (
          <div key={index} className="sticky-section">
            <div className="sticky-wrapper">
              <div className="horizontal-line-top" />
              <div className="content-block">
                <img src={signup} className="signup-ico" alt="signup" />
                <div className="number-wrapper">
                  <h1 className="lef-number">{item.number}</h1>
                </div>
                <h3 className="lef-title">[ {item.heading.toUpperCase()} ]</h3>
                <p className="lef-desc">{item.body}</p>
              </div>
              <div className="horizontal-line-bottom" />
            </div>
          </div>
        ))}
      </div>

      {/* RIGHT SCROLL CONTENT */}
      <div className="carousel-right">
        {content.map((item, index) => (
          <React.Fragment key={index}>
            <div
              className="content-section"
              ref={el => (sectionRefs.current[index] = el)}
              data-index={index}
            >
              <img src={illustrations[index]} className="illu" alt="" />
            </div>
            {index < content.length - 1 && (
              <div className="section-divider">
                <div className="divider-line" />
                <div className="divider-content">
                  <span className="divider-number">{item.number}</span>
                  <span className="divider-arrow">â†’</span>
                  <span className="divider-number">{content[index + 1].number}</span>
                </div>
                <div className="divider-line" />
              </div>
            )}
          </React.Fragment>
        ))}
      </div>

      <style>{`
        * {
          margin: 0;
          padding: 0;
          box-sizing: border-box;
        }

        body {
          background-color: #000;
          color: #fff;
          font-family: 'Raleway', 'Arial', sans-serif;
        }

        .scroll-carousel {
          display: flex;
          width: 100%;
          position: relative;
          background-color: #000;
        }

        .carousel-left {
          width: 40%;
          background-color: #000;
        }

        .sticky-section {
          height: 100vh;
          position: relative;
        }

        .sticky-wrapper {
          position: sticky;
          top: 0;
          height: 100vh;
          display: flex;
          flex-direction: column;
          justify-content: center;
          padding: 0 5%;
        }

        .horizontal-line-top,
        .horizontal-line-bottom {
          width: 100%;
          height: 2px;
          background: linear-gradient(to right, #fff, #666, #000);
        }

        .horizontal-line-top {
          margin-bottom: 40px;
        }

        .horizontal-line-bottom {
          margin-top: 40px;
        }

        .content-block {
          padding: 40px 0;
          position: relative;
        }

        .number-wrapper {
          text-align: right;
          margin-bottom: -40px;
        }

        .lef-number {
          font-size: 120px;
          font-weight: 200;
          font-family: Raleway, Arial, sans-serif;
          line-height: 1;
          color: #fff;
          opacity: 0.15;
          letter-spacing: -5px;
        }

        .lef-title {
          font-size: 42px;
          font-weight: 300;
          text-align: left;
          color: white;
          margin-bottom: 30px;
          letter-spacing: 2px;
        }

        .lef-desc {
          font-size: 20px;
          opacity: 0.7;
          width: 90%;
          line-height: 1.6;
          text-align: left;
          font-family: Raleway, Arial, sans-serif;
          font-weight: 400;
        }

        .signup-ico {
          width: 48px;
          position: absolute;
          top: -80px;
          left: 0;
        }

        .carousel-right {
          width: 60%;
          border-left: 1px solid rgb(192, 192, 192);
          background-color: #000;
        }

        .content-section {
          height: 100vh;
          display: flex;
          flex-direction: column;
          justify-content: center;
          align-items: center;
          background-color: #000;
        }

        .illu {
          max-width: 80%;
          height: auto;
        }

        .section-divider {
          height: 20vh;
          display: flex;
          align-items: center;
          justify-content: center;
          gap: 30px;
          padding: 0 60px;
          background-color: #000;
        }

        .divider-line {
          flex: 1;
          height: 1px;
          background: linear-gradient(to right, transparent, #666, transparent);
        }

        .divider-content {
          display: flex;
          align-items: center;
          gap: 20px;
          color: #666;
          font-size: 24px;
          font-weight: 300;
          font-family: Raleway, Arial, sans-serif;
        }

        .divider-number {
          font-size: 32px;
          color: #999;
        }

        .divider-arrow {
          color: #666;
          font-size: 28px;
        }
      `}</style>
    </div>
  );
}
